final class BACnet_Device_Address extends ffi.Struct {
  /// mac_len = 0 is a broadcast address
  @ffi.Uint8()
  external int mac_len;

  /// note: MAC for IP addresses uses 4 bytes for addr, 2 bytes for port */
  /// /* use de/encode_unsigned32/16 for re/storing the IP address
  @ffi.Array.multi([7])
  external ffi.Array<ffi.Uint8> mac;

  /// BACnet network number
  @ffi.Uint16()
  external int net;

  /// length of MAC address
  @ffi.Uint8()
  external int len;

  /// hwaddr (MAC) address
  @ffi.Array.multi([7])
  external ffi.Array<ffi.Uint8> adr;
}

typedef BACNET_ADDRESS = BACnet_Device_Address;

